l><p>Upto Rs. 50 lakhs&nbsp;for purchase of a new two wheeler.</p><p>Upto Rs.&nbsp;200 lakhs for purchase of a new car.</p><ul><li><p>Margin - For New Vehicles&nbsp;: 15 %&nbsp;. In case of Corporate Salary Arrangement, 10% of on road price for new car.<br />In case of Old Car 20% (up to 3 year old).</p></li><li><p>Interest charged on daily reducing balance</p></li><li><p>No prepayment charges</p></li><li><p>Security- Hypothecation of the vehicle purchased.</p></li><li><p>Mode of disbursement- Loan disbursed directly to the authorized dealer.</p></li><li><p>Repayment- Maximum up to&nbsp;84 months for new vehicle.<br />2nd hand four-wheeler (up to 3 year old)- Maximum up to 36 months.</p></li></ul>',0,1111111,'2017-09-27 03:01:44',NULL,NULL),(19,25,'Fee & Charges','<ul><li><p>Two wheeler- Rs. 250/- (Plus service tax as applicable from time to time)</p></li><li><p>For Car Loan: Rs 500/- irrespective of loan amount. (Plus service tax as applicable from time to time)</p></li></ul>',0,1111111,'2017-09-27 03:03:04',NULL,NULL),(20,25,'Documents','<ul><li><p>Application form with 2 photographs &amp; KYC</p></li><li><p>Vehicle proforma Invoice</p></li><li><p>6 Month Bank Statement</p></li><li><p>3 Month Salary Slips</p></li><li><p>Form -16 along with 2 years ITR</p></li><li><p>36 Cheques</p></li></ul>',0,1111111,'2017-09-27 03:03:25',NULL,NULL),(21,50,'Quick Guide','<p>quick guide</p>',0,1111111,'2017-09-27 10:57:04',1111111,'2017-09-29 09:50:24'),(22,53,'Quick Guide','<p>Deposit Money</p>',0,1111111,'2017-09-29 06:32:34',1111111,'2017-09-29 06:32:48'),(23,49,'Quick Guide','<p>GUIDE</p>',0,1111111,'2017-09-29 10:15:18',1111111,'2017-09-29 10:15:35'),(24,54,'Quick Guide','<p>A General Description</p>',0,1111111,'2017-10-09 09:48:23',NULL,NULL),(26,54,'Terms','<p>Terms</p>',0,1111111,'2017-10-09 09:49:35',NULL,NULL);
